    fn get_encoder() -> Encoder {
        Encoder::new(n, k, t, &get_prime_poly())
    }

    fn get_ready_encoder() -> Encoder {
        Encoder::new_with_gen_poly(n, k, t, get_gen_poly())
    }

    fn get_simple_decoder() -> SimpleDecoder {
        SimpleDecoder::new(n, k, t, &get_prime_poly())
    }

    fn get_ready_simple_decoder() -> SimpleDecoder {
        SimpleDecoder::new_with_gen_poly(n, k, t, get_gen_poly())
    }

    fn get_berlekamp_decoder() -> BerlekampDecoder {
        BerlekampDecoder::new(n, k, t, &get_prime_poly())
    }

    fn get_ready_berlekamp_decoder() -> BerlekampDecoder {
        BerlekampDecoder::new_with_gen_poly(n, k, t, get_gen_poly(), get_adding_table())
    }

    fn generate_random_msg_and_code_word() -> (BitVec, BitVec) {
        let mut msg = BitVec::new();
        for _i in 0..k {
            msg.push(rand::random());
        }
        // let encoder = get_encoder();
        let encoder = get_ready_encoder();
        let word = encoder.encode(&msg).unwrap();
        (msg, word)
    }

    #[test]
    #[ignore]
    fn test_single_errors_simple_decoder() {
        let (msg, code_word) = generate_random_msg_and_code_word(); //TODO save coders to file
        let simple = get_ready_simple_decoder();

        let start = Instant::now();
        for i in 0..511 {
            println!("i: {}", i);
            let mut code_word_clone = code_word.clone();
            code_word_clone.inverse_nth(i);
            let (decoded, _) = simple.decode(&code_word_clone).unwrap();
            assert_eq!(msg, decoded);
        }

        let stop = Instant::now();
        println!("Decoding took: {:?}", stop.duration_since(start));
        println!(
            "Mean time {:?}",
            stop.duration_since(start) / code_word.len() as u32
        );
    }

    #[test]
    #[ignore]
    fn test_decodable_max_errors_simple_decoder() {
        let (msg, code_word) = generate_random_msg_and_code_word(); //TODO save coders to file
        let simple = get_ready_simple_decoder();

        let start = Instant::now();
        let mut code_word_clone = code_word.clone();
        for i in 0..20 {
            code_word_clone.inverse_nth(i);
        }
        let (decoded, _) = simple.decode(&code_word_clone).unwrap();
        assert_eq!(msg, decoded);

        let stop = Instant::now();
        println!("Decoding took: {:?}", stop.duration_since(start));
        println!(
            "Mean time {:?}",
            stop.duration_since(start) / code_word.len() as u32
        );
    }

    #[test]
    #[ignore]
    fn test_single_errors_berlekamp_decoder_small() {
        let (msg, code_word) = generate_random_msg_and_code_word(); //TODO save coders to file
        let berlekamp = get_berlekamp_decoder();

        let places_1 = vec![50, 150, 250, 350, 450];
        let start = Instant::now();
        for i in places_1.iter() {
            println!("i: {}", i);
            let mut code_word_clone = code_word.clone();
            code_word_clone.inverse_nth(*i);
            let (decoded, _) = berlekamp.decode(&code_word_clone).unwrap();
            assert_eq!(msg, decoded);
        }
        let stop = Instant::now();

        println!("Decoding took: {:?}", stop.duration_since(start));
        println!("Mean time {:?}", stop.duration_since(start) / 5);
    }

    #[test]
    #[ignore]
    fn test_single_errors_berlekamp_decoder() {
        let (msg, code_word) = generate_random_msg_and_code_word(); //TODO save coders to file
        let berlekamp = get_ready_berlekamp_decoder();

        let places_1 = vec![50, 150, 250, 350, 450];
        let places_2 = vec![110, 210, 310, 410, 510];
        let places_3 = vec![0, 100, 200, 300, 400];

        let (tx1, rx1) = mpsc::channel();
        let code_word_clone = code_word.clone();
        let msg_clone = msg.clone();
        let berlekamp_clone = berlekamp.clone();
        let first = thread::spawn(move || {
            let start = Instant::now();
            for i in places_1.iter() {
                println!("first thread i: {}", i);
                let mut next_code_word_clone = code_word_clone.clone();
                next_code_word_clone.inverse_nth(*i as usize);
                let (decoded, _) = berlekamp_clone.decode(&next_code_word_clone).unwrap();
                assert_eq!(msg_clone, decoded);
            }
            let stop = Instant::now();
            tx1.send(stop.duration_since(start).as_secs()).unwrap();
        });
        let (tx2, rx2) = mpsc::channel();
        let code_word_clone = code_word.clone();
        let msg_clone = msg.clone();
        let berlekamp_clone = berlekamp.clone();
        let second = thread::spawn(move || {
            let start = Instant::now();
            for i in places_2.iter() {
                println!("second thread i: {}", i);
                let mut next_code_word_clone = code_word_clone.clone();
                next_code_word_clone.inverse_nth(*i as usize);
                println!("aaaa");
                let (decoded, _) = berlekamp_clone.decode(&next_code_word_clone).unwrap();
                println!("hfers");
                assert_eq!(msg_clone, decoded);
            }
            let stop = Instant::now();
            println!("tutua");
            tx2.send(stop.duration_since(start).as_secs()).unwrap();
        });
        let (tx3, rx3) = mpsc::channel();
        let code_word_clone = code_word.clone();
        let msg_clone = msg.clone();
        let berlekamp_clone = berlekamp.clone();
        let third = thread::spawn(move || {
            let start = Instant::now();
            for i in places_3.iter() {
                println!("third thread i: {}", i);
                let mut next_code_word_clone = code_word_clone.clone();
                next_code_word_clone.inverse_nth(*i as usize);
                let (decoded, _) = berlekamp_clone.decode(&next_code_word_clone).unwrap();
                assert_eq!(msg_clone, decoded);
            }
            let stop = Instant::now();
            tx3.send(stop.duration_since(start).as_secs()).unwrap();
        });

        first.join();
        second.join();
        third.join();

        let time1 = rx1.recv().unwrap();
        let time2 = rx2.recv().unwrap();
        let time3 = rx3.recv().unwrap();
        let sum = time1 + time2 + time3;

        println!("Decoding took: {:?}", sum);
        println!("Mean time {:?}", sum / 15);
    }

